Sensing Murder (America version 4:3)

Dream House Nightmare

Original Air Date 28 June 2006

On March 29, 1999, Sarasota, Florida resident Deborah Dalzell was found murdered in the bathroom of her brand new dream home. Eight years later, the case is still unsolved. Two of America's top psychics seek clues by sensing this sinister murder.

